import axios from "axios";





const API_KEY ="25e76afbf295cbfd0bad02cb10868c86"

const URL ="https://api.openweathermap.org/data/2.5/weather"



 const fetchWeather= async (query)=>{
  const {data}=  await axios.get(URL,{
        params:{
             q:query,
             units:"metric",
             AppID:API_KEY
        }
    })
    return data
}


